:root {
  --innerContPaddingSides: 40px;
  --innerContMarginTop: 70px;
  --gridTopPadding: 56px;
  --gridRowHeight: 157.5px;
  --gridColWidth: 236px;
  --halfGridColWidth: calc(var(--gridColWidth)/2);
  --yellow: #fedd02;
}

* {
  font-family: "Roboto", sans-serif;
}

.outer-container {
  max-width: 1440px;
  margin-left: auto;
  margin-right: auto;
}

.nav-container {
  width: 200px;
}

.inner-container {
  min-width: 1200px;
  max-width: 1200px;
  width: 70%;
}

.years-container {
  width: 50px;
}

.landing-screen {
  width: 100vw;
  height: 100vh;
  opacity: 0;
}
.landing-screen.fading-in {
  opacity: 1;
  transition: opacity 1.5s;
}
.landing-screen.fading-out {
  opacity: 0;
  transition: opacity 0.2s;
}

.landing-img {
  width: 100%;
  height: 100%;
  object-fit: cover;
}

.enter-button {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  color: grey;
  font-size: 35px;
  padding: 10px 20px;
  transition: all 0.3s;
  background: white;
  text-transform: uppercase;
  letter-spacing: 0.2em;
}
.enter-button:hover {
  color: #585858;
  cursor: pointer;
}

.main-screen {
  display: none;
  opacity: 0;
}
.main-screen.fading-in {
  opacity: 1;
  transition: opacity 1s;
}
.main-screen .outer-container {
  display: flex;
}
.main-screen--nav-container {
  background: var(--yellow);
}
.main-screen--years-container {
  background: var(--yellow);
}
.main-screen--inner-container {
  margin-top: var(--innerContMarginTop);
  background: url("/7f3a0dc887feb1465ed4ed5aeab28f7e.svg") no-repeat;
  background-position: center 0;
  background-size: calc(1200px - var(--innerContPaddingSides)*2);
  height: 2800px;
  position: relative;
  padding: var(--gridTopPadding) var(--innerContPaddingSides) 0 var(--innerContPaddingSides);
  display: grid;
  grid-template-columns: repeat(4, var(--gridColWidth));
  grid-template-rows: repeat(10, var(--gridRowHeight));
  justify-items: center;
  align-items: center;
}

.main-screen--icon {
  transform: scale(1.03);
  cursor: pointer;
}
.main-screen--icon.irregular-center {
  margin-right: -250px;
}
.main-screen--icon.irregular-right {
  margin-right: -469px;
}
.main-screen--icon.regular-center {
  margin-right: -30px;
}
.main-screen--icon-pole {
  grid-column: 1;
  grid-row: 2;
}
.main-screen--icon-tree {
  grid-column: 2;
  grid-row: 2;
}
.main-screen--icon-cells-2 {
  grid-column: 4;
  grid-row: 2;
}
.main-screen--icon-dog {
  grid-column: 2;
  grid-row: 3;
}
.main-screen--icon-flow {
  grid-column: 2;
  grid-row: 4;
}

